    false,nt"url": null,nt"notes": "This annual narrative report for Pablo
    NWR outlines Refuge accomplishments during the 1989 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. The report includes
    a planning section which discusses research and investigations. Refuge administration
    is outlined; information about personnel is given. Habitat management is also covered;
    subjects include wetlands, croplands, grasslands, grazing, haying, and pest control.
    The wildlife section of the report discusses wildlife diversity, endangered and
    threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    and game mammals. The public uses of the Refuge described in this report include
    outdoor classrooms, interpretive programs, hunting, fishing, wildlife observation,
    and law enforcement. The equipment and facilities section of the report provides
    information about new construction. Items of interest are provided at the end. Field
    guides are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
